import React from 'react';
import ReactDOM from 'react-dom/client';
import WebsiteRoutes from './WebsiteRoutes';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <WebsiteRoutes />
  </React.StrictMode>
);

